import React from 'react';
import { SafeAreaView, Text, View } from 'react-native';

const HomeScreen = () =>{
    return(
        <SafeAreaView>
        <View>
            <Text>HomeScreen</Text>
        </View>
        </SafeAreaView>
    )
}

export default HomeScreen;
